/*
	需求：实现基于椭圆曲线ECDSA的数字签名和签名的验证
	基本步骤
	1.生成ECDSA密匙对并写入磁盘
	2.读取ecdsa私匙并对明文散列值进行签名
	3.读取ecdsa公匙验证数字签名的正确性
*/
//------------1.获取ECDSA密匙对
func GenerateEccKey() {
	//----------获取私匙并写入磁盘----------
	/*
		 	Step1.生成ecc私匙
		 	函数：func GenerateKey(c elliptic.Curve, rand io.Reader) (priv *PrivateKey, err error)
		 	作用：生成ecdsa的密匙对
		 	返回参数1：私匙
		 	type PrivateKey struct {
		    				PublicKey
							D   *big.Int
						}
		 	其中，
		 	type PublicKey struct {
		 					elliptic.Curve
		 					X, Y *big.Int
						}
		 	返回参数2：error
		 	参数1：elliptic包中实现了几条覆盖素数有限域的标准椭圆曲线，选择椭圆曲线
		 	参数2：rand.Reader
	*/
	privKey, err := ecdsa.GenerateKey(elliptic.P256(), rand.Reader)
	if err != nil {
		panic(err)
	}
	//Step2:采用x509序列化
	derText, err := x509.MarshalECPrivateKey(privKey)
	if err != nil {
		panic(err)
	}
	//Step3:组织一个pem的block结构体
	block := pem.Block{
		Type:  "ECDSA Private Key",
		Bytes: derText,
	}
	//Step4:进行pem编码
	file, err := os.Create("eccPrivate.pem")
	if err != nil {
		panic(err)
	}
	defer file.Close()
	pem.Encode(file, &block)
	//----------获取公匙并写入磁盘----------
	//Step1:获取公匙
	publicKey := privKey.PublicKey
	//Step2:采用x509序列化
	derText, err = x509.MarshalPKIXPublicKey(&publicKey)
	if err != nil {
		panic(err)
	}
	//Step3:组织一个pem的block结构体
	block = pem.Block{
		Type:  "ECDSA Public Key",
		Bytes: derText,
	}
	//Step4:进行pem编码
	file, err = os.Create("eccPublic.pem")
	if err != nil {
		panic(err)
	}
	defer file.Close()
	pem.Encode(file, &block)
}

func GenerateSpecificPrivateKey(d *big.Int, c elliptic.Curve) (*ecdsa.PrivateKey, error) {
	priv := new(ecdsa.PrivateKey)
	priv.D = d
	priv.PublicKey.Curve = c
	priv.PublicKey.X, priv.PublicKey.Y = c.ScalarBaseMult(d.Bytes())
	return priv, nil
}

